import base64

# base64 string থেকে 'data:image/png;base64,' অংশটা বাদ দিতে হবে
base64_string = ""  # আপনার স্ট্রিং এখানে বসান

# ডিকোড করা
image_data = base64.b64decode(base64_string)

# ফাইল হিসেবে সংরক্ষণ
with open("output_image.png", "wb") as f:
    f.write(image_data)

print("✅ ইমেজ ফাইল সংরক্ষিত হয়েছে: output_image.png")
